该接口返回一个指针对象，该对象内部有一个next方法
每次调用next都会将指针指向数据结构的下一位
返回一个对象{value:value,done:false}或者{value:undefined,done:true}

1，解构赋值，对数组和set进行解构赋值，会默认调用Symbol.iterator方法
2，扩展运算符，扩展运算符也会默认调用Symbol.iterator方法 也就是说只要一个数据结构部署了Symbol.iterator就可以使用扩展运算符，将其转为数组
3，yeild* 如果yeild*后面跟的是一个可遍历结构，则会调用该结构的Symbol.iterator接口
4，所有接收数组作为参数的场合都调用了Symbol.iterator接口
// 例如：
// for...of
// Array.from()
// Map(), Set(), WeakMap(), WeakSet()（比如new Map([['a',1],['b',2]])）
// Promise.all()
// Promise.race()
